    t[12183] = "<p>Returns the squared coefficient of variation of the number of clients in service process at the station whose ID is specified in the parameter.</p>\n<p>Alternatively, the following other parameterizations are also possible:</p>\n<li>ID of a client source (in this case the results refer to the clients which are created at the selected source)</li>\n<li>2 parameter: ID of a station and ID of a source (in this case the results refer to a station and at the station to the clients which are created at the selected source)</li>\n<li>2 parameter: ID of a multi source and 1-based index of the client type at the source (in this case the results refer to the clients which are created at the selected multi source)</li>\n<li>3 parameter: ID of a station, ID of a multi source and 1-based index of the client type at the source  (in this case the results refer to a station and at the station to the clients which are created at the selected multi source)</li>\n<ul>\n</ul>";
    t[12186] = "Distribution.NormalInfo";
    t[12187] = "<p>The normal distribution results as a <b>theoretical limit distribution</b> when many independent distributions are executed one after the other.</p>\n<p>The parameters of the normal distribution are both its expected value and its standard deviation. This means that the parameters of the normal distribution can be set very easily (in practically any software).</p>\n<p>The normal distribution can always take on negative values. It is therefore <b>not suitable for modeling durations</b>. Log-normal distribution or gamma distribution are usually much better suited for this purpose. These can also be parameterized directly in Warteschlangensimulator via expected value and standard deviation.</p>";
